import React from 'react';
import logo from './logo.svg';
import './App.css';
import CourseComponent from './components/CourseComponent';
// import CourseForm from './components/CourseForm';


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { CourseForm } from './components/CourseForm';


export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/getUserInput">getUserInput</Link>
            </li>
            <li>
              <Link to="/getResultCourses">getResultCourses</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return (
    <div className="App">
        <CourseComponent />
    </div>
  );
}

function getUserInput() {
  return (
    <div className="App">
        <CourseForm />
    </div>
  );
}

function getResultCourses() {
  return <h2>Users</h2>;
}

